import React from 'react'
import './style.css'

const tabpanels =["Overview","tab2", "tab3", "tab4"]

const Tabs = ({}) => {
  return ( 
    <div>
        <div className='tabPanel'>
            {
                tabpanels.map((item, index )=> (
                    <div className='tabItem' key={index}>
                        {item}
                    </div>
                ))
            }
        </div>
        <div>
            
        </div>
    </div>
  )
}

export default Tabs
